          street: body.street && body.street,
        });
      }
      console.log("api res ::", res);
      setActiveImg(body.images ? body.images[0] : tableimg);
      setIsLoading(false);
      switch (body.module) {
        case "PROPERTY":
          dispatch(
            saveActiveProperty({
              id: body.id,
              children: body.children,
              name: body.name,
            })
          );

          break;
        case "ROOM":
          dispatch(
            saveActiveRoom({
              id: body.id,
              children: body.children,
              name: body.name,
            })
          );
          break;
      }
    } else {
